import React from "react";

const MenuItem = ({ item }) => {
  return <li>{item}</li>;
};

const MenuList = ({ menu }) => {
  return (
    <ul className="d-flex text-white">
      {menu.map((menuItem, index) => (
        <MenuItem item={menuItem} key={index} />
      ))}
    </ul>
  );
};
export default MenuList;
